    }
  }

  $clickIconSpacing: 1vw;

  &.booking {
    .section-text {
      margin: 0 0 0 $horizontalGap;
      border-top: 1px solid utility.$line-colors;
      border-bottom: 1px solid utility.$line-colors;
      border-left: 1px solid utility.$line-colors;      
      > div {
        margin: $horizontalGap;
